ControlPropertyState.AutoRuleBindingString:
ClearCollect(
    SelectedRepoBranches,
    AddColumns(
        CustomAzureDevOps.GetBranches(
            drpAdoOrganizations_1.Selected.AccountName,
            drpAdoProjects_1.Selected.name,
            drpRepos_1.Selected.id
