);
Set(
    DefaultRepoSettingName,
    "LastSavedRepo"
);
Set(
    DefaultRepo,
    LookUp(
        AppUserSetting.'User Settings',
        Name = DefaultRepoSettingName
    )
);
If(
    IsBlank(DefaultRepo),
    Set(
        DefaultRepo,
        Patch(
            'User Settings',
            {
                'App User Setting': AppUserSetting,
                Name: DefaultRepoSettingName,
                Value: First(SelectedProjectRepos).name
