);
Select(fncLoadEnvironmentDeploymentSettings);
UpdateContext(
    {
        showDeploymentSettingsLoader: false,
        showConnectionReferenceSettings: true
    }
);

Select(Parent);
Launch(
    LookUp(
        SolutionsLatestBuildStatuses,
        uniquename = ThisItem.uniquename
    ).exportToGitStatus._links.web.href
);

Select(Parent);
Launch(
    LookUp(
        SolutionsLatestBuildStatuses,
        uniquename = ThisItem.uniquename
    ).exportToGitStatus._links.web.href
);

