    "https://dev.azure.com/" & drpAdoOrganizations_1.Selected.AccountName & 
    "/" & drpAdoProjects_1.Selected.name & 
    "/_git/" & drpRepos_1.Selected.name & 
    "/pullrequest/" & 
    LookUp(
        SolutionsLatestBuildStatuses,
