,{Name: "PrimaryColor3Value", Value: "#FF00FF"}
,{Name: "PrimaryColor3TextValue", Value: "#FF00FF"}
,{Name: "defaultLabelColorValue", Value: "#FF3333")})

ForAll(
    SelectedEnvironmentSolutions As e,
    Collect(
        TempSolutionsLatestBuildStatuses,
        {
            uniquename: e.uniquename,
            exportToGitStatus: First(
                CustomAzureDevOps.GetBuilds(
                    drpAdoOrganizations_1.Selected.AccountName,
                    drpAdoProjects_1.Selected.name,
                    {
                        requestedFor: gblAzureDevOpsUserId,
                        definitions: "17",
                        '$top': 1,
                        queryOrder: "queueTimeDescending",
                        buildNumber: "export-" & e.uniquename & "-to-git-branch"
                    }
                ).value
            ),
            pullRequestStatus: CustomAzureDevOps.GetPullReqeust(
                drpAdoOrganizations_1.Selected.AccountName,
                drpAdoProjects_1.Selected.name,
                drpRepos_1.Selected.id,
                LookUp(LastSavedPullRequests, solutionUniqueName = e.uniquename, pullRequestId)
            )
        }
    );

);
ClearCollect(
    SolutionsLatestBuildStatuses,
    TempSolutionsLatestBuildStatuses
);
